import React from 'react';
import './Elementarybox.css'

const ElementaryBox = () => {
    const mainBoxStyle = {
        width: '1154px',
        height: '216px',
        position: 'relative',
        margin: '20px auto',
        border: '1px solid #000',
        backgroundColor: 'rgb(255, 211, 105)',
    };

    const subBoxStyle = {
        width: '261px',
        height: '216px',
        position: 'absolute',
        bottom: '0',
        marginRight: '30px', // Расстояние между подбоксами
    };

    const backgroundImageStyle1 = {
        width: '100%',
        height: '50%',
        backgroundImage: 'url("link-to-image1.jpg")', // Замените ссылку на реальный путь к изображению
        backgroundSize: 'cover',
        backgroundPosition: 'center',
    };

    const backgroundImageStyle2 = {
        width: '100%',
        height: '50%',
        backgroundImage: 'url("link-to-image2.jpg")', // Замените ссылку на реальный путь к изображению
        backgroundSize: 'cover',
        backgroundPosition: 'center',
    };

    const backgroundImageStyle3 = {
        width: '100%',
        height: '50%',
        backgroundImage: 'url("link-to-image3.jpg")', // Замените ссылку на реальный путь к изображению
        backgroundSize: 'cover',
        backgroundPosition: 'center',
    };

    const backgroundImageStyle4 = {
        width: '100%',
        height: '50%',
        backgroundImage: 'url("link-to-image4.jpg")', // Замените ссылку на реальный путь к изображению
        backgroundSize: 'cover',
        backgroundPosition: 'center',
    };




    return (
        <div className="elementarybox">
            <div style={mainBoxStyle}>
                <div style={{ ...backgroundImageStyle1 }}></div>
                <div style={{ ...subBoxStyle, left: '0', background: 'linear-gradient(to bottom, lightblue 50%, lightgreen 50%)' }}></div>

                <div style={{ ...backgroundImageStyle2 }}></div>
                <div style={{ ...subBoxStyle, left: '291px', background: 'linear-gradient(to bottom, lightblue 50%, lightgreen 50%)' }}></div>

                <div style={{ ...backgroundImageStyle3 }}></div>
                <div style={{ ...subBoxStyle, left: '582px', background: 'linear-gradient(to bottom, lightblue 50%, lightgreen 50%)' }}></div>

                <div style={{ ...backgroundImageStyle4 }}></div>
                <div style={{ ...subBoxStyle, left: '873px', background: 'linear-gradient(to bottom, lightblue 50%, lightgreen 50%)' }}></div>
            </div>
        </div>
    );
};

export default ElementaryBox;
